import src.e2vdom

def on_compile(application, object, action_name, context, objects):
	result=objects
	for xobject in object.get_objects_list():
		result.append({"object": xobject})
	return result

class VDOM_tree(VDOM_object):

	def render(self, parent, contents=""):

		id = 'o_' + (self.id).replace('-', '_')

		if self.visible == "1":
			vis=""
		else:
			vis="display:none;"

		result = ""

		import StringIO
		resultIO = StringIO.StringIO()

		style=u"%s z-index: %s;position: %s;top: %spx;left: %spx;width: %spx;height: %spx; overflow: visible;"%(vis, self.zindex, self.position, self.top, self.left, self.width, self.height)

		resultIO.write(u"""
			<div class='dynatreetype' style='%(style)s' id='%(id)s'> %(contents)s %(data)s""" % {
			"style" : style,
			"id" : id,
			"contents" : contents,
			"data" : self.data
			}
		)

		result += resultIO.getvalue()
		resultIO.close()

		result_s = u"""</div>
<script type='text/javascript' charset="UTF-8">
jQuery(document).ready(function(){
	jQuery('#%(id)s').dynatree({
        title: '%(title)s',
        rootVisible: %(showtitle)s,
		checkbox: %(checkbox)s,
		keyboard: %(keyboard)s,
		autoCollapse: %(autoCollapse)s,
		%(children)s
		selectMode: %(selectMode)s,
        %(fx)s
        debugLevel: 0,

		onActivate: function(node) {
			var id='%(id)s'; 
			console.info(id);
			console.info(node);
			console.info(node.data.title);
            execEventBinded(id.substring(2, id.length), "activate", {
				title:node.data.title,
				key:node.data.key,
				isFolder:node.data.isFolder
			});
		},
      	onDeactivate: function(node) {

		},
		onSelect: function(flag, node) {
			var id='%(id)s'; 
            execEventBinded(id.substring(2, id.length), "select", {} );
        },

		onExpand: function(node) {
			fixfooter()
		},

		dnd: {
			onDragStart: function(node) {
				/** This function MUST be defined to enable dragging for the tree.
				 *  Return false to cancel dragging of node.
				 */
				//logMsg("tree.onDragStart(%(o)s)", node);
				if(node.data.isFolder)
				  return false;
				return true;
			},
			onDragStop: function(node) {
				logMsg("tree.onDragStop(%(o)s)", node);
			}
		}

	});
});
</script>""" % {
"id" : id,
"title" : self.title,
"showtitle" : self.showtitle,
"o"	: "%o",
"checkbox" 		: self.checkbox,
"keyboard" 		: self.keyboard,
"autoCollapse" 	: self.autoCollapse,
"children"		: "" if not self.initAjax 	else "children: %(initAjax)s, " % {"initAjax" : self.initAjax},
"selectMode" 	: self.selectMode,
"fx"			: "" if not self.fx 		else "fx: %(fx)s, " % {"fx" : self.fx},
}
		result += result_s
		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):

		result="<container id=\"%s\" zindex=\"%s\" hierarchy=\"%s\" order=\"%s\" top=\"%s\" left=\"%s\" width=\"%s\" height=\"%s\">"\
					"<svg>"\
						"<rect x=\"%s\" y=\"%s\" width=\"%s\" height=\"%s\" fill=\"#EEEEEE\" fill-opacity=\".4\" />"\
					"</svg>%s"\
				"</container>"%(
					self.id, self.zindex, self.hierarchy, self.order, self.top, self.left, self.width, self.height,
					0, 0, self.width, self.height,
					contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)

